  // Require that EthSwap has enough tokens\n    require(token.balanceOf(address(this)) >= tokenAmount);\n\n    // Transfer tokens to the user\n    token.transfer(msg.sender, tokenAmount);\n\n    // Emit an event\n    emit TokensPurchased(msg.sender, address(token), tokenAmount, rate);\n  }\n\n  function sellTokens(uint _amount) public payable {\n    // User can\'t sell more tokens than they have\n    require(token.balanceOf(msg.sender) >= _amount);\n\n    // Calculate the amount of Ether to redeem\n    uint etherAmount = _amount / rate;\n\n    // Require that EthSwap has enough Ether\n    require(address(this).balance >= etherAmount);\n\n    // Perform sale\n    token.transferFrom(msg.sender, address(this), _amount);\n    msg.sender.transfer(etherAmount);\n\n    // Emit an event\n    emit TokensSold(msg.sender, address(token), _amount, rate);\n  }\n\n}\n',sourcePath:"C:\\Users\\Administrador\\Desktop\\pro01\\eth_swap-6-sell-tokens-fe\\src\\contracts\\EthSwap.sol",ast:{absolutePath:"project:/src/contracts/EthSwap.sol",exportedSymbols:{EthSwap:[141]},id:142,nodeType:"SourceUnit",nodes:[{id:1,literals:["solidity","^","0.5",".0"],nodeType:"PragmaDirective",src:"0:23:0"},{absolutePath:"project:/src/contracts/Token.sol",file:"./Token.sol",id:2,nodeType:"ImportDirective",scope:142,sourceUnit:380,src:"25:21:0",symbolAliases:[],unitAlias:""},{baseContracts:[],contractDependencies:[],contractKind:"contract",documentation:null,fullyImplemented:!0,id:141,linearizedBaseContracts:[141],name:"EthSwap",nodeType:"ContractDefinition",nodes:[{constant:!1,id:5,name:"name",nodeType:"VariableDeclaration",scope:141,src:"69:47:0",stateVariable:!0,storageLocation:"default",typeDescriptions:{typeIdentifier:"t_string_storage",typeString:"string"},typeName:{id:3,name:"string",nodeType:"ElementaryTypeName",src:"69:6:0",typeDescriptions:{typeIdentifier:"t_string_storage_ptr",typeString:"string"}},value:{argumentTypes:null,hexValue:"4574685377617020496e7374616e742045786368616e6765",id:4,isConsta